values:
I guess I've been a little out of it the past few days...it's just weird trying to get back into the hang of a school schedule. The first few days have been alright though. My teachers are certainly interesting, at least!

I like this place so far, though. Everyone I've met has been friendly and the classes are, well...as interesting as can be expected from school, right? ^^;

Well, there's a little more homework I need to finish before I go to bed, but before that, I got a messenger name like everyone else has been using. It might be easier to get in touch with people this way, right? So if anyone needs me, my name on there is <b>the ever eternal</b>. (I heard it in a song today and it was all I could think of.) So I guess that's it!
